import React from "react";

const Signin = () => {
  return (
    <form>
      <label for="email">email</label>
      <input type="email" placeholder="email" id="email" name="email" />
      <label for="password">email</label>
      <input
        type="password"
        placeholder="password"
        id="password"
        name="password"
      />
    </form>
  );
};

export default Signin;
